function Events() {
  const events = [
    { id: 1, title: "Event 1" },
    { id: 2, title: "Event 2" },
    { id: 3, title: "Event 3" },
    { id: 4, title: "Event 4" },
    { id: 5, title: "Event 5" },
  ];
  return (
    <>
      {" "}
      <h1>Events</h1>{" "}
      {events.map((items) => (
        <li key={items.id}>
          <Link to={`events/${items.id}`}>{items.title}</Link>
        </li>
      ))}{" "}
    </>
  );
}

export default Events;
